import React, { useEffect } from 'react';
import { useStateContext } from '../context/StateContext';
import { useNavigate } from 'react-router-dom';

const TableView = () => {
  const { selectedTableData } = useStateContext();
  const navigate = useNavigate();

  // Debugging logs
  useEffect(() => {
    console.log("Table data received:", selectedTableData);
  }, [selectedTableData]);

  if (!selectedTableData || !selectedTableData.rows) {
    return (
      <div style={{ padding: '20px', color: 'red' }}>
        <p>Error: No data received for table.</p>
        <button onClick={() => navigate(-1)}>Go Back</button>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px' }}>
      <h2>{selectedTableData.name || 'Untitled Table'}</h2>
      <button onClick={() => navigate(-1)}>Go Back</button>

      {selectedTableData.rows.length === 0 ? (
        <p>Table exists but contains no rows.</p>
      ) : (
        <table style={{ borderCollapse: 'collapse', width: '100%' }}>
          <thead>
            <tr>
              {selectedTableData.headers.map((header, i) => (
                <th key={i} style={{ border: '1px solid #ddd', padding: '8px' }}>
                  {header}
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {selectedTableData.rows.map((row, i) => (
              <tr key={i}>
                {row.map((cell, j) => (
                  <td key={j} style={{ border: '1px solid #ddd', padding: '8px' }}>
                    {cell}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};
export default TableView;
